        return (
            <div>
                <h2 align="center">Return order form</h2>
                <form>
                    <h3>Personal information</h3>
                    <label>Name</label>
                    <input type="text" id="name" value={this.state.name}/>

                    <h3>Package information</h3>

                    <h3>Delivery information</h3>

                </form>
            </div>
        );
    }
}

export default Form;
